import React from 'react';
import styled from 'styled-components';
import { FiExternalLink, FiBookmark, FiTag } from 'react-icons/fi';

const DealsContainer = styled.div`
  max-height: 400px;
  overflow-y: auto;
`;

const DealItem = styled.div`
  display: flex;
  gap: 15px;
  padding: 15px 0;
  border-bottom: 1px solid rgba(255, 255, 255, 0.1);
  
  &:last-child {
    border-bottom: none;
  }
`;

const DealImage = styled.img`
  width: 80px;
  height: 60px;
  object-fit: cover;
  border-radius: 8px;
  background: rgba(255, 255, 255, 0.1);
`;

const DealContent = styled.div`
  flex: 1;
`;

const DealTitle = styled.h4`
  margin: 0 0 8px 0;
  font-size: 14px;
  line-height: 1.4;
  color: white;
`;

const DealPrice = styled.div`
  display: flex;
  align-items: center;
  gap: 10px;
  margin-bottom: 8px;
`;

const CurrentPrice = styled.span`
  font-size: 16px;
  font-weight: 600;
  color: #4ade80;
`;

const OriginalPrice = styled.span`
  font-size: 12px;
  color: rgba(255, 255, 255, 0.6);
  text-decoration: line-through;
`;

const Discount = styled.span`
  background: #ef4444;
  color: white;
  padding: 2px 6px;
  border-radius: 4px;
  font-size: 10px;
  font-weight: 600;
`;

const DealMeta = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  font-size: 11px;
  color: rgba(255, 255, 255, 0.6);
`;

const DealActions = styled.div`
  display: flex;
  gap: 10px;
`;

const ActionButton = styled.button`
  background: none;
  border: none;
  color: rgba(255, 255, 255, 0.6);
  cursor: pointer;
  padding: 4px;
  border-radius: 4px;
  transition: all 0.2s ease;

  &:hover {
    color: white;
    background: rgba(255, 255, 255, 0.1);
  }
`;

const LoadingMessage = styled.div`
  text-align: center;
  padding: 40px;
  color: rgba(255, 255, 255, 0.6);
`;

function DealsSection({ data, loading, onUserAction }) {
  if (loading) {
    return <LoadingMessage>Loading hot deals...</LoadingMessage>;
  }

  if (!data || !data.deals) {
    return <LoadingMessage>No deals available at the moment.</LoadingMessage>;
  }

  const handleAction = (action, deal) => {
    onUserAction(action, deal.id, 'deals');
  };

  return (
    <DealsContainer>
      {data.deals.slice(0, 5).map((deal, index) => (
        <DealItem key={deal.id || index}>
          <DealImage 
            src={deal.image_url || '/placeholder-deal.jpg'} 
            alt={deal.title}
            onError={(e) => {
              e.target.style.display = 'none';
            }}
          />
          <DealContent>
            <DealTitle>{deal.title}</DealTitle>
            <DealPrice>
              <CurrentPrice>${deal.price}</CurrentPrice>
              {deal.original_price && (
                <OriginalPrice>${deal.original_price}</OriginalPrice>
              )}
              {deal.discount && (
                <Discount>
                  <FiTag />
                  {deal.discount}% OFF
                </Discount>
              )}
            </DealPrice>
            <DealMeta>
              <span>{deal.platform}</span>
              <DealActions>
                <ActionButton 
                  onClick={() => handleAction('bookmark', deal)}
                  title="Save Deal"
                >
                  <FiBookmark />
                </ActionButton>
                <ActionButton 
                  onClick={() => {
                    window.open(deal.url, '_blank');
                    handleAction('click', deal);
                  }}
                  title="View Deal"
                >
                  <FiExternalLink />
                </ActionButton>
              </DealActions>
            </DealMeta>
          </DealContent>
        </DealItem>
      ))}
    </DealsContainer>
  );
}

export default DealsSection;
